export default {
    unmounted()
   {
    console.log("unmounted")
   },
   mounted()
   {
    console.log("mounted")
   },
   created()
   {
    console.log("created")
   },
   beforeCreate()
   {
    console.log("beforeCreate")
   },
   updated()
   {
    console.log("updated")
   },
   beforeUpdate()
   {
    console.log(" before Update")
